import React from 'react'
import styled from 'styled-components'

const Card = styled.span`
    border: 1px solid black;
    border-radius: 25%;

`;

const aboutCard = () => {
    return (
        <div>
            <Card>
                <p>Hi my name is Lucas.</p>
            </Card>
        </div>
    )
}

export default aboutCard
